	public class Map2Builder
		: MapBuilder
	{
		public override MapRoot Build()
		{
			MapRoot map = new MapRoot (128, 128, 64, 64, Moxy.ContentManager.Load<Texture2D> ("fantasytileset"), ((GameState)Moxy.StateManager["Game"]).camera);
			map.AmbientColor = new Color (0, 0, 0, 0);
			map.BackgroundTexture = Moxy.ContentManager.Load<Texture2D> ("background");

			//// Load lights
			Texture2D lightTexture = Moxy.ContentManager.Load<Texture2D> ("light");
			map.PointLights.Add (new Light (Color.White, lightTexture) { Location = new Vector2 (3718, 6139) });

			//// Add monster spawning
			//AddMonster (map, new Vector2 (4017, 1896), "Slime", 1f, 10);
			//AddMonster (map, new Vector2 (1784, 352), "Slime", 1f, 10);
			//AddMonster (map, new Vector2 (208, 1797), "Slime", 1f, 10);

			////Add Player Spawn
			map.PlayerSpawns[0] = new Vector2 (3718, 6139);
			map.PlayerSpawns[1] = new Vector2 (3718, 6139);
			map.PlayerSpawns[2] = new Vector2 (3718, 6139);
			map.PlayerSpawns[3] = new Vector2 (3718, 6139);

			loadBaseLayer (map);
			//loadDecalLayer (map);
			//map.Layers[(int)MapLayerType.Collision] = map.Layers[(int)MapLayerType.Decal];

			return map;
		}

